The base domain of the identity provider that issues JSON Web Tokens. For example,
            an Amazon Cognito user pool has the following format: https://cognito-idp.{region}.amazonaws.com/{userPoolId}
                          . Required for the JWT authorizer type. Supported only for HTTP APIs.

A key-value map specifying request parameters that are passed from the method request
            to the backend. The key is an integration request parameter name and the associated
            value is a method request parameter value or static value that must be enclosed within
            single quotes and pre-encoded as required by the backend. The method request parameter
            value must match the pattern of method.request.{location}.{name}
                          , where                   {location}    
                       is querystring, path, or header; and                   {name}
                           must be a valid and unique method request parameter name. Supported
            only for WebSocket APIs.

The base domain of the identity provider that issues JSON Web Tokens. For example,
            an Amazon Cognito user pool has the following format: https://cognito-idp.{region}.amazonaws.com/{userPoolId}
                          . Required for the JWT authorizer type. Supported only for HTTP APIs.

A key-value map specifying request parameters that are passed from the method request
            to the backend. The key is an integration request parameter name and the associated
            value is a method request parameter value or static value that must be enclosed within
            single quotes and pre-encoded as required by the backend. The method request parameter
            value must match the pattern of method.request.{location}.{name}
                          , where                   {location}    
                       is querystring, path, or header; and                   {name}
                           must be a valid and unique method request parameter name. Supported
            only for WebSocket APIs.

A key-value map specifying response parameters that are passed to the method response
            from the backend. The key is a method response header parameter name and the mapped
            value is an integration response header value, a static value enclosed within a pair
            of single quotes, or a JSON expression from the integration response body. The mapping
            key must match the pattern of method.response.header.{name}
                          , where name is a valid and unique header name. The mapped non-static
            value must match the pattern of integration.response.header.{name}
                           or integration.response.body.{JSON-expression}
                          , where                   {name}        
                   is a valid and unique response header name and                   {JSON-expression}
                           is a valid JSON expression without the $ prefix.
